import React from 'react';
import {BrowserRouter , Route} from 'react-router-dom'
import './App.css';

import Login from './components/Login';

function App() {
  return (
      <BrowserRouter>
        <Login/>
        <Route path="/" exact component={Login} />
      </BrowserRouter> 
  );
}

export default App;
